// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Counter {
    
    int256 number;

    function getNumber() public view returns (int256)
    {
        return number;
    }

    function inc() public returns (int256)
    {
        return number+=1;
    }

    function dec() public returns (int256)
    {
        return number-=1;
    }
}

